--
-- Table structure for table `appointments`
--

CREATE TABLE `appointments` (
  `id` int(50) NOT NULL,
  `consultant_id` int(40) DEFAULT NULL,
  `customer_id` int(40) DEFAULT NULL,
  `schedule_id` int(40) DEFAULT NULL,
  `map` varchar(40) DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `type` varchar(40) DEFAULT NULL,
  `from_date` varchar(40) DEFAULT NULL,
  `to_date` varchar(40) DEFAULT NULL,
  `appointment_date` varchar(400) DEFAULT NULL,
  `appointment_type` varchar(400) DEFAULT NULL,
  `status` enum('Pending','Cancelled','Started','Completed','Confirmed','NoShowByCustomer','NoShowByConsultant','Reject') DEFAULT 'Confirmed',
  `insurance_id` int(40) DEFAULT NULL,
  `policyid` varchar(400) DEFAULT NULL,
  `rawdata` text DEFAULT NULL,
  `approval` enum('Confirmed','Pending','Cancelled') DEFAULT 'Confirmed',
  `slot` varchar(40) DEFAULT NULL,
  `cancell_customer` varchar(40) DEFAULT NULL,
  `cancell_consultant` varchar(40) DEFAULT NULL,
  `consultant_command` text DEFAULT NULL,
  `pay_in` varchar(10) NOT NULL DEFAULT '0',
  `pay_out` varchar(12) DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

